@elonmusk @realDonaldTrump Sr. Musk, bom dia!

Tenho uma filhinha que aos sete anos contraiu um câncer raro e aos 9 veio a obto.  Tenho questionado muito a Deus o porque do sofrimento das criancinhas. Desde então venho ajudado as pessoas e as crianças, mas sou insignificante. 
Deus abençoe o sr
